import React from 'react'
import Sidebar from '../../components/sidebar/Sidebar'
import Navsection from '../../components/navbar/Navsection'
import './chapter3.scss'
import { useNavigate } from "react-router-dom"
import  SyntaxHighlighter  from 'react-syntax-highlighter';
import {far} from 'react-syntax-highlighter/dist/esm/styles/hljs';
const Chapter3 = () => {
    // ----------------
    // const navigate = useNavigate();

    // const transfer = (txt) => {
    //     if (txt.includes(":)")) {
    //         setTimeout(() => navigate('/'), 500);

    //     }
    // }
    const submit = (e) => {
        e.preventDefault();

        const code = document.getElementById("input").value;
        const data = { code: code };
        fetch('/code3', {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify(data)
        })
            .then(res => res.text())
            .then(txt => alert(txt))
            // .then(txt => transfer(txt))

    }
    return (
        <div className='introduction'>
            {/* <Sidebar /> */}
            <div className="introductionContainer">
                {/* <Navsection /> */}
                <div className="widgets">
                    <div className="left">
                        <span className="title">
                            <h1>Chapter 3: Java Methods</h1>
                            <p >A method is a block of code which only runs when it is invoked.
                                We can pass data (known as parameters) into a method.
                                Methods are called to perform things, so we also called method as functions.
                                It is much easier to define a method once and reuse it many times.
                            </p>
                            <p>Java has some build-in methods like System.out.println(),
                                However, we can make our own methods.
                                Note, a method must be declared within a class.
                            </p>
                            <p>aMethod () is the name.
                                static means that this method belong to the Main class, and it is not a object of the Main class.
                                void means that this method returns nothing.
                            </p>
                        </span>

                    </div>
                </div>
                <div className="widgets">
                    <h2>Call a Method</h2>
                    <span>For example:
                        <hr style={{ color: "Background" }} />
                        Inside Main, call the aMethod() method:</span>
                    <p style={{ color: "green" }}>

                        <hr style={{ color: "Background" }} />

                        public class Main {'{'}
                        <hr style={{ color: "Background" }} />

                        static void aMethod() {'{'}

                        System.out.println("A Java Tutor!");{'}'}
                        <hr style={{ color: "Background" }} />
                        public static void main(String[] args) {'{'}

                        aMethod();
                        {'}'}
                        <hr style={{ color: "Background" }} />




                        {'}'}

                    </p>
                    <p></p>
                </div>
                <div className="widgets">
                    <h2>Java Method Parameters</h2>
                    <span>For example:
                        <hr style={{ color: "Background" }} />
                        We can pass information to methods using parameter.
                    </span>
                    <p style={{ color: "green" }}>
                        public class Main {'{'}
                        <hr style={{ color: "Background" }} />

                        static void aMethod(String fname, int age) {'{'}
                        <hr style={{ color: "Background" }} />

                        System.out.println(fname + " is " + age);
                        <hr style={{ color: "Background" }} />

                        {'}'}
                        <hr style={{ color: "Background" }} />

                        public static void main(String[] args) {'{'}
                        <hr style={{ color: "Background" }} />

                        aMethod("Xin", 5);
                        <hr style={{ color: "Background" }} />

                        aMethod("Hao", 8);

                        {'}'}
                        <hr style={{ color: "Background" }} />

                        {'}'}
                        <hr style={{ color: "Background" }} />

                        putput: Xin is 5;Hao is 8




                    </p>
                </div>


                <div className="widgets">
                    <h3>A Tutorial Video about Java Methods:</h3>
                    <div style={{ "border-radius": '30px' }} dangerouslySetInnerHTML={{ __html: "<iframe src='https://www.youtube.com/embed/r0SewFmbCUI' frameborder='0' autoplay; allowfullscreen   />" }} />
                    <div className=""></div>

                </div>




                <div className="widgets">
                    <h3 >Exercise: </h3>


                    <p>
                        static void myMethod() {'{'}   <hr style={{ color: "Background" }} />

                        System.out.println("I just got executed!");<hr style={{ color: "Background" }} />
                        {'}'}<hr style={{ color: "Background" }} />

                        public static void main(String[] args) {'{'}<hr style={{ color: "Background" }} />
                        ________;<hr style={{ color: "Background" }} />
                        {'}'}
                    </p>


                    <form onSubmit={(e) => { submit(e) }}>
                        <textarea
                            class="input shadow"
                            name="name"
                            rows="15"
                            cols="100"
                            placeholder="please enter your Java code here:"


                            style={{ marginTop: "10px", width: "400px", height: "200px" }} type="text" id="input" ></textarea>
                        <button className="btn btn-primary" style={{ marginLeft: "10px" }} id="button" type="submit">submit</button>
                    </form>
                </div>
            </div>
        </div>
    )
}
export default Chapter3
